import React from 'react';

const Playground = () => {
  const posts = [
    {
      name: 'a',
      length: 100,
      title: 'important',
    },
    {
      name: 'b',
      length: 200,
      title: 'not important',
    },
  ];

  function getPosts() {
    setTimeout(() => {
      console.log('getPosts');
    }, 500);
  }

  return (
    <div>
      <div style={{ margin: 20 }}>
        <h1>Playground</h1>
        {getPosts()}
      </div>
    </div>
  );
};

export default Playground;
